import React from 'react'

const List = (props) => {
    const {people} = props;
	return (
		<>
            {people.map((person,index) => {
                return <article className="person">
                <img src={person.image} alt={person.name} />
                <div>
                    <h4>{person.name}</h4>
                    <p>{person.age} years</p>
                </div>
            </article>
            })}
		</>
	)
}



export default List
